import { Box, Grid, Paper, Typography } from '@material-ui/core';
import NewReservationForm from './NewReservationForm/NewReservationForm';
import useStyles from './useStyles';

const engForm = {
    lantype: 'type',
    lanfrom: 'from',
    lanto: 'to',
    lanpax: 'pax',
    lanhotel: 'hotel',
    lanfullName: 'full name',
    lanpassenger: 'passenger',
    landriverNote: 'driver note'
};

const turkishForm = {
    lantype: 'tip',
    lanfrom: 'nerden',
    lanto: 'nereye',
    lanpax: 'pax',
    lanhotel: 'otel',
    lanfullName: 'ad soyad',
    lanpassenger: 'yolcu',
    landriverNote: 'sürücü notu '
}

function NewReservation(): JSX.Element {
    const classes = useStyles();
    let lan = 'tr';

    return (
        <>
            <Grid container component={Paper} className={classes.root} alignItems='center'>
                <Grid item xs={12} sm={12} md={12} lg={12} >
                    <Box
                        display="flex"
                        flexDirection="column"
                        minHeight="100vh"
                    >
                        <Box>
                            <Typography variant="h2" color="primary" className={classes.title}>
                                add reservation
                            </Typography>
                            <NewReservationForm form={lan ==='tr' ? turkishForm : engForm} />
                        </Box>
                    </Box>
                </Grid>
            </Grid>
        </>
    )
}

export default NewReservation;
